import fetchStaticDataFromAPI from './api/StaticData';
import './App.css';

function App() {
  const [data, setData] = useState([]);

  const fetchData = async () => {
    try {
      const testData = await fetchStaticDataFromAPI();
      setData(testData);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

